func findMinimumOperations(s1 string, s2 string, s3 string) int {
    // Initialize the count of operations to 0
    operations := 0

    // Loop until all strings are empty or one of them becomes empty
    for len(s1) > 0 && len(s2) > 0 && len(s3) > 0 {
        // If all three strings have the same last character, we can remove them without any operation
        if s1[len(s1)-1] == s2[len(s2)-1] && s2[len(s2)-1] == s3[len(s3)-1] {
            s1 = s1[:len(s1)-1]
            s2 = s2[:len(s2)-1]
            s3 = s3[:len(s3)-1]
        } else {
            // If not, we need to perform operations on one or more strings
            if len(s1) >= 2 && (s1[len(s1)-1] != s2[len(s2)-1] || s1[len(s1)-1] != s3[len(s3)-1]) {
                s1 = s1[:len(s1)-1]
                operations++
            }
            if len(s2) >= 2 && (s2[len(s2)-1] != s1[len(s1)-1] || s2[len(s2)-1] != s3[len(s3)-1]) {
                s2 = s2[:len(s2)-1]
                operations++
            }
            if len(s3) >= 2 && (s3[len(s3)-1] != s1[len(s1)-1] || s3[len(s3)-1] != s2[len(s2)-1]) {
                s3 = s3[:len(s3)-1]
                operations++
            }
        }

        // If all strings are equal, return the operations count
        if s1 == s2 && s2 == s3 {
            return operations
        }

        // If any of the strings becomes empty, and not all are equal, return -1
        if len(s1) == 0 || len(s2) == 0 || len(s3) == 0 {
            return -1
        }
    }

    // If all strings are made equal
    if s1 == s2 && s2 == s3 {
        return operations
    }

    // If it's not possible to make them equal
    return -1
}
